INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 101, 110, 122601, 1, 0, 0.029, 105, 1, 1.5, 0, 1, 160, 1);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 102, 105, 122401, 0, 0, 0.014, 111, 2, 2.5, 1, 3, 120, 2);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 103, 110, 122501, 0, 1, 0.017, 105, 3, 2.5, 0, 2, 350, 3);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 104, 110, 107501, 0, 0, 0.016, 105, 4, 1.5, 1, 3, 130, 4);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105, 110, 107601, 1, 0, 0.014, 105, 5, 2.5, 0, 1, 160, 5);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 106, 120, 107801, 0, 1, 0.029, 103, 6, 3.5, 0, 2, 255, 6);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 107, 120, 110601, 1, 0, 0.013, 103, 7, 3.5, 0, 1, 160, 7);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 108, 110, 110401, 0, 1, 0.014, 103, 8, 2.5, 0, 2, 350, 8);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 109, 105, 110501, 0, 0, 0.012, 100, 9, 1.5, 1, 3, 130, 9);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 110, 105, 115701, 1, 0, 0.014, 103, 10, 2.5, 0, 1, 200, 10);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 111, 105, 113601, 0, 1, 0.071, 103, 11, 2.5, 0, 2, 350, 11);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 112, 120, 107901, 0, 0, 0.014, 103, 12, 1.5, 1, 3, 130, 12);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 113, 110, 108001, 1, 0, 0.022, 105, 13, 1.5, 0, 2, 200, 13);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 114, 110, 110301, 1, 0, 0.031, 108, 14, 2.5, 0, 1, 160, 14);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 115, 110, 107701, 0, 0, 0.036, 105, 15, 0.5, 1, 1, 130, 15);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 116, 110, 113101, 0, 1, 0.048, 95, 16, 3.5, 0, 2, 350, 16);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 117, 105, 113301, 0, 0, 0.043, 105, 17, 1.5, 1, 3, 130, 17);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 118, 105, 113201, 0, 0, 0.018, 95, 18, 1.5, 1, 2, 130, 18);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 119, 110, 117001, 1, 0, 0.021, 108, 19, 2.5, 0, 2, 160, 19);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 120, 110, 113501, 0, 1, 0.036, 105, 20, 2.5, 0, 1, 255, 20);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 121, 105, 113401, 0, 1, 0.02, 105, 21, 2.5, 0, 3, 350, 21);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 122, 110, 110101, 0, 0, 0.018, 105, 22, 2.5, 1, 1, 130, 22);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 123, 105, 110001, 1, 0, 0.03, 111, 23, 3.5, 0, 3, 160, 23);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 124, 110, 117201, 0, 0, 0.027, 103, 24, 1.5, 1, 1, 130, 24);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 125, 105, 117301, 1, 0, 0.02, 108, 25, 3.5, 0, 2, 160, 25);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 126, 110, 117401, 0, 1, 0.04, 105, 26, 2.5, 0, 3, 350, 26);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 127, 110, 117101, 0, 1, 0.009, 105, 27, 3.5, 0, 1, 350, 27);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 128, 120, 122901, 0, 1, 0.022, 105, 28, 3.5, 0, 1, 255, 28);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 129, 110, 122801, 0, 0, 0.028, 105, 29, 2.5, 1, 3, 130, 29);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 130, 105, 122701, 1, 0, 0.023, 108, 30, 3.5, 0, 2, 130, 30);
